/* ðŸŒˆ This is the client side ðŸŒˆ*/

/* dependencies */
import fetch from "isomorphic-unfetch";

/* layout */
import DefaultLayout from "../../components/layouts/DefaultLayout";

/* components */

import Navbar from '../../components/NavBar/NavBar';
import AboutData from '../../components/aboutContent/aboutContent'

function fetchUrl(url) {
    return fetch(url).then(r => r.json());
  }

  const About = ({ data }) => {
    const { content } = data;
    const aboutContentData = content.components.find((item) => item.component === 'Content');

  return (
    <DefaultLayout>
    <Navbar/>
    {aboutContentData.Group.map(data => {
      return  <aboutContent img={data.Image} title={data.Title}  body={data.Text} intro={data.Intro} />
      })}     
    </DefaultLayout>
  );
}
export const getServerSideProps = async () => {
    const data = await fetchUrl(`http://localhost:3000/api/page/about`);
  return { props: { data } }
}

export default About
